function ChallengeCard() {
    const challenges = ["Wiki Race", "Unique Hunt (monster)", "Unique Hunt (clue scroll)", "Red Click Race", "Inventory Puzzle", "Item Hunt", "Location Guesser", "OSRS Trivia", "Resource Rush", "Boss Speedrun"];
    return (
        <div className="ChallengeCard-container">
            {challenges.map((challenge, idx) => (
                <label key={idx} style={{ display: "block" }}>
                    <input type="checkbox" />
                    {challenge}
                </label>
            ))}
        </div>
    );
}

export default ChallengeCard;
